import React, { useState, useEffect } from "react"
import { Link } from "react-router-dom"

const Tracks = props => {
    const [playlist, setPlaylist] = useState({})

    useEffect(() => {
        console.log('effect')
        if (props.location.state.list) {
            props.history.push({
                state: {
                    history: props.location.state.list.id,
                    cachedPlaylist: props.location.state.playlist
                }
            })
            let list = props.location.state.list
            setPlaylist(list)
        }
    }, [])
    console.log(props.location.state.list)

    return (
        <div>
            Tracks! Linked here by {playlist.name}
            <Link to={"/main/"}> Go back </Link>
        </div>
    )
}

export default Tracks
